(1, 'Gartner Supply Chain Executive Conference 2017', '<p><strong>Gartner is the source for technology-related insight for cli</strong>ents who want to make the right decision every time. Thats why their Supply Chain Executive Conference is a top pick for our supply chain management conference list  not to mention the fact that it features comprehensive tracks and sessions covering the entire spectrum of supply chain and focuses on helping supply chain executives learn how to create and manage a bimodal value chain strategy that achieves essential performance goals while simultaneously allowing for iteration and experimentation. The Gartner Supply Chain Executive Conference is perfect for chief supply chain officers, supply chain planning executives, procurement and manufacturing executives, and logistics and distribution executives.</p>\r\n<h1>Gartner is the source for technology-related</h1>\r\n<p>Gartner is the source for technology-related insight for clients who want to make the right decision every time. Thats why their Supply Chain Executive Conference is a top pick for our supply chain management conference list  not to mention the fact that it features comprehensive tracks and sessions covering the entire spectrum of supply chain and focuses on helping supply chain executives learn how to create and manage a bimodal value chain strategy that achieves essential performance goals while simultaneously allowing for iteration and experimentation. The Gartner Supply Chain Executive Conference is perfect for chief supply chain officers, supply chain planning executives, procurement and manufacturing executives, and logistics and distribution executives.Gartner is the source for technology-related insight for clients who want to make the right decision every time. Thats why their Supply Chain Executive Conference is a top pick for our supply chain management conference list  not to mention the fact that it features comprehensive tracks and sessions covering the entire spectrum of supply chain and focuses on helping supply chain executives learn how to create and manage a bimodal value chain strategy that achieves essential performance goals while simultaneously allowing for iteration and experimentation. The Gartner Supply Chain Executive Conference is perfect for chief supply chain officers, supply chain planning executives, procurement and manufacturing executives, and logistics and distribution executives.Gartner is the source for technology-related insight for clients who want to make the right decision every time. Thats why their Supply Chain Executive Conference is a top pick for our supply chain management conference list  not to mention the fact that it features comprehensive tracks and sessions covering the entire spectrum of supply chain and focuses on helping supply chain executives learn how to create and manage a bimodal value chain strategy that achieves essential performance goals while simultaneously allowing for iteration and experimentation. The Gartner Supply Chain Executive Conference is perfect for chief supply chain officers, supply chain planning executives, procurement and manufacturing executives, and logistics and distribution executives.</p>', 'GB', 'AZ', 'Phoenix', '@Gartner_inc\r\n', 1490436000, 1490522400, 1, 1, 1489831842, 1490353338, 2, 2, 0),
(2, ' Midwest Association of Rail Shippers Winter Meeting 2017', '<h1>Shippers Winterz</h1>\r\n<p>The Midwest Association of Rail Shippers (MARS) seeks to provide an open forum for resolving transportation and car supply problems, along with educational programs for its membership regarding railroad operating practices, transportation innovations, and legislative matters. Their supply chain management conferences take place twice a year, with the first occurring in January 2017 inOakbrook, Illinois. The MARS Winter Meeting features a reception, new member orientation, and sessions on key industry topics.</p>\r\n<p></p>\r\n<p>he Midwest Association of Rail Shippers (MARS) seeks to provide an open forum for resolving transportation and car supply problems, along with educational programs for its membership regarding railroad operating practices, transportation innovations, and legislative matters. Their supply chain management conferences take place twice a year, with the first occurring in January 2017 inOakbrook, Illinois. The MARS Winter Meeting features a reception, new member orientation, and sessions on key industry topics.he Midwest Association of Rail Shippers (MARS) seeks to provide an open forum for resolving transportation and car supply problems, along with educational programs for its membership regarding railroad operating practices, transportation innovations, and legislative matters. Their supply chain management conferences take place twice a year, with the first occurring in January 2017 inOakbrook, Illinois. The MARS Winter Meeting features a reception, new member orientation, and sessions on key industry topics.he Midwest Association of Rail Shippers (MARS) seeks to provide an open forum for resolving transportation and car supply problems, along with educational programs for its membership regarding railroad operating practices, transportation innovations, and legislative matters. Their supply chain management conferences take place twice a year, 