(3, 'Global Cold Chain Expo Supply Chain Innovation Summit', '<p><strong>The Supply Chain InnovationSummit takes place in mid-November 2016, so check back for more information on</strong> the 2017 event date and location. What we do know is that this supply chain conference is a must-attend event for supply chain managers and organizations looking to hear from some of the worlds leading senior executives in supply chain and inventory management. Focusing on supply chain innovation and technology, the Supply Chain Innovation Summit features tools, techniques, data, interactive workshops, networking opportunities, and more for attendeesThe Supply Chain InnovationSummit takes place in mid-November 2016, so check back for more information on the 2017 event date and location. What we do know is that this supply chain conference is a must-attend event for supply chain managers and organizations looking to hear from some of the worlds leading senior executives in supply chain and inventory management. Focusing on supply chain innovation and technology, the Supply Chain Innovation Summit features tools, techniques, data, interactive workshops, networking opportunities, and more for attendeesThe Supply Chain InnovationSummit takes place in mid-November 2016, so check back for more information on the 2017 event date and location. What we do know is that this supply chain conference is a must-attend event for supply chain managers and organizations looking to hear from some of the worlds leading senior executives in supply chain and inventory management. Focusing on supply chain innovation and technology, the Supply Chain Innovation Summit features tools, techniques, data, interactive workshops, networking opportunities, and more for attendees</p>', 'GB', 'OHia ', 'London', 'Gulmohar hall,\r\nEast London', 1490436900, 1490868900, 1, 1, 1489834441, 1490180789, 2, 2, 0),
(4, '11th Annual Health Care Supply Chain Management Summit', '<p><strong><a href="http://www.worldcongress.com/events/HL17006/" rel="noreferrer" target="_blank">11th Annual Health Care Supply ChainManagement Summit</a><br /></strong><a href="https://twitter.com/Wrldhealthcare" rel="noreferrer" target="_blank">@WrldHealthcare</a></p>\r\n<p>The 11th Annual Health Care Supply Chain Management Summit will take place in January 2017 in New Orleans, Louisiana. This supply chain management event features executive networking opportunities and distinguished and expert speakers. Health Care Supply Chain Management Summit sessions in 2017 will be geared toward strategies for optimizing contracting, logistics, and value analysis supply chain operations. Attendees of this supply chain conference will engage in in-depth discussion of benchmarking strategies for achieving the next frontier of supply chain operations.</p>\r\n<p><strong>Cost to Attend:</strong></p>\r\n<ul>\r\n<li>Standard Conference: $2,095 by December 16</li>\r\n<li>Standard Conference plus Flash Drive: $2,195by December 16</li>\r\n<li>Hospital &amp; Health Systems Conference: $895 by December 16</li>\r\n<li>Hospital &amp; Health Systems Conference plus Flash Drive: $995 by December 16</li>\r\n<li>Academic Conference: $895 by December 16</li>\r\n<li>AcademicConferenceplus Flash Drive: $995 by December 16</li>\r\n</ul>\r\n<p></p>\r\n<p>The 11th Annual Health Care Supply Chain Management Summit will take place in January 2017 in New Orleans, Louisiana. This supply chain management event features executive networking opportunities and distinguished and expert speakers. Health Care Supply Chain Management Summit sessions in 2017 will be geared toward strategies for optimizing contracting, logistics, and value analysis supply chain operations. Attendees of this supply chain conference will engage in in-depth discussion of benchmarking strategies for achieving the next frontier of supply chain operations.</p>\r\n<p><strong>Cost to Attend:</strong></p>\r\n<ul>\r\n<li>Standard Conference: $2,095 by December 16</li>\r\n<li>Standard Conference plus Flash Drive: $2,195by December 16</li>\r\n<li>Hospital &amp; Health Systems Conference: $895 by December 16</li>\r\n<li>Hospital &amp; Health Systems Conference plus Flash Drive: $995 by December 16</li>\r\n<li>Academic Conference: $895 by December 16</li>\r\n<li>AcademicConferenceplus Flash Drive: $995 by December 16</li>\r\n</ul>', 'GB', 'LA', ' New Orleans', '@willey\r\nDown town pick street', 1490784600, 1490871000, 1, 1, 1489834633, 1489835105, 2, 2, 0),
(5, 'seventh  Annual North American SupplyChain Summit Chicago', '<p>The 8th Annual North American Supply Chain Summit: Chicago will be held at the Radisson Blu Aqua. This supply chain event typically sells out, so dont wait to register if you want to have the opportunity to attend this roadmap to supply chains data-driven transformation. Now in its eighth year, this supply chain conference is one of North Americas largest and best-attended gatherings of high-level logistics and supply chain executives.; in 2016, more than 650 senior supply chain and logistics executives attended, and even more are expected to attend in 2017<br /><br />Cost to Attend:<br /><br /> Standard Conference: $2,095 by December 16<br /> Standard Conference plus Flash Drive: $2,195 by December 16<br /> Hospital &amp; Health Systems Conference: $895 by December 16<br /> Hospital &amp; Health Systems Conference plus Flash Drive: $995 by December 16<br /> Academic Conference: $895 by December 16<br /> Academic Conference plus Flash Drive: $995 by December 16<br /><br />Tearms and conditions:<br /><br /> Standard Conference: $2,095 by December 16<br /> Standard Conference plus Flash Drive: $2,195 by December 16<br /> Hospital &amp; Health Systems Conference: $895 by December 16<br /> Hospital &amp; Health Systems Conference plus Flash Drive: $995 by December 16<br /> Academic Conference: $895 by December 16<br /> Academic Conference plus Flash Drive: $995 by December 16<br /><br /><br /><br /></p>', 'GB', 'Chicago', 'Chicago', '@eyefortransport\r\nJune 14-16\r\nChicago, IL', 1490878500, 1493582100, 1, 1, 1489841993, 1490180587, 18, 2, 0),
