(1, 'Linux Engineers ', '<p><img src="@@PLUGINFILE@@/download2.png" width="161" height="126" /></p>\r\n<p>Syslint Technologies-India</p>\r\n<p>Fresher</p>\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="688">\r\n<p>Qualification : B.E/ B.Tech/ MCA/ M.Tech.<br /><br /> Experience / Freshers<br /><br /> Required Skills</p>\r\n<ul type="disc">\r\n<li>Should be a graduate</li>\r\n<li>Advanced knowledge ofLinux</li>\r\n<li>Good knowledge on cPanel/WHM</li>\r\n<li>Knowledge of shell scripting</li>\r\n<li>Excellent problem solving skills and troubleshooting skills</li>\r\n<li>Flexible schedule.</li>\r\n<li>Should have good Written and Communication Skill</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Allen Jospeh', 'Syslint Technologies', 1, 1, 1, 1492646400, 1489826384, 1490356703, 2, 2, 0),
(2, 'Required Technical support engineer immediately ', '<p><img src="@@PLUGINFILE@@/download3.jpg" width="251" height="201" /></p>\r\n<p>Genpact-Gurgaon, Haryana</p>\r\n<p>20,000 a month</p>\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="688">\r\n<p>24*7 PC Hardware, Networking, Troubleshooting, OS Support</p>\r\n<p>Location: Noida</p>\r\n<p>Experience: 0 - 2 Years Facilities: Cab and Meal Provided Job Summary Provide 24*7 Online, Remote ethical tech support relate to Technical support services of PC Hardware, Desktop, Laptop, Networking, Antivirus, Bug Fixing, OS support, diagnosis, repair and performance optimization. US Shift Timings. Salary upto Rs.22500</p>\r\n<p>Job Type: Full-time</p>\r\n<p>Salary: 20,000.00 /month</p>\r\n<p>Job Location:</p>\r\n<ul type="disc">\r\n<li>Noida, Uttar Pradesh</li>\r\n</ul>\r\n<p>Required education:</p>\r\n<ul type="disc">\r\n<li>High school or equivalent</li>\r\n</ul>\r\n<p>Required experience:</p>\r\n<ul type="disc">\r\n<li>fresher to: 1 year</li>\r\n</ul>\r\n<p>Required language:</p>\r\n<ul type="disc">\r\n<li>hindi english</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'suren', 'Genpact', 2, 1, 1, 1492819200, 1489826610, 1490330387, 2, 2, 0),
(3, 'Network support Engineer, Fresher ', '<p><img src="@@PLUGINFILE@@/download1.jpg" width="282" height="179" /></p>\r\n<p>Accel Frontline Limited<a href="https://www.indeed.co.in/cmp/Accel-Frontline-Limited/reviews" rel="noreferrer" target="_blank">141 reviews</a>-Bangalore, Karnataka</p>\r\n<p>13,00,000 a year- Fresher</p>\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="602">\r\n<ul type="disc">\r\n<li>Freshers with Good communication skills &amp; good attitude.</li>\r\n<li>Basic knowledge in Hardware &amp; networking</li>\r\n<li>Interested to work anywhere in India</li>\r\n</ul>\r\n<p>Salary: 1,300,000.00 /year</p>\r\n<p>Required experience:</p>\r\n<ul type="disc">\r\n<li>0-1: 1 year</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Lori Anderson', 'Accel Frontline', 3, 1, 1, 1492560000, 1489826878, 1490356900, 2, 2, 0),
(4, 'Freshers for Embedded, VLSI, RF Engineers form ECE ', '<p>Planet Sigma-Hyderabad, Andhra Pradesh<br /> 8,000 a month- Fresher</p>\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="602">\r\n<p>Freshers for Embedded, VLSI, RF Engineers form B.E/ B.Tech ECE group</p>\r\n<p>Job Type: Fresher</p>\r\n<p>Salary: 8,000.00 /month</p>\r\n<p>Job Location:</p>\r\n<ul type="disc">\r\n<li>Hyderabad, Andhra Pradesh</li>\r\n</ul>\r\n<p>Required education:</p>\r\n<ul type="disc">\r\n<li>Bachelor''s</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Asha Lenin', 'Planet Sigma', 4, 1, 1, 1492646400, 1489826961, 1490357068, 2, 2, 0),
(5, 'Trainee Engineer ', '<p>Nakshatech Private Limited  Bangalore, Karnataka</p>\r\n<ul type="disc">\r\n<li>Autocad knowledge</li>\r\n<li>Graduation in science or diploma-BCA/BCS/Bsc</li>\r\n<li>Knowledge in all MS packages</li>\r\n<li>Training Period- one month</li>\r\n<li>Must work with a team</li>\r\n<li>Good communication skill</li>\r\n</ul>\r\n<p>Qualification: - MSc in Geology.</p>\r\n<p>You have to bring your updated Resume, Passport Size Photograph, Copies of the testimonials substantiatingyour qualification, your college and your experience.</p>\r\n<p>Freshers Required. MSc in Geology</p>', 'Mahalakshmi.k', 'Nakshatech Private Limited', 5, 1, 0, 1492214400, 1489832287, 1489832287, 2, 2, 0),
(6, 'BE Engineer with MBA - Fresher/Trainee ', '<p>ZESOL-Bangalore, Karnataka<br /> Full-time,Fresher</p>\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="602">\r\n<p>MBA fresher with BE background required.</p>\r\n<p>We are a start up in the product development and research space, and tasks will involve market research, SCM, general management activities</p>\r\n<p>We want candidates who are career oriented and would like to add value to the resume. Not the candidates who are looking for monetary benefit alone.</p>\r\n<p>Probationary Salary including bonus - 100000 p.a.</p>\r\n<p>Probation Period - 3 to 6 months</p>\r\n<p>Job Type: Full-time</p>\r\n<p>Job Location:</p>\r\n<ul type="disc">\r\n<li>Bangalore, Karnataka</li>\r\n</ul>\r\n<p>Required education:</p>\r\n<ul type="disc">\r\n<li>Master''s</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Ivo', 'ZESOL ', 7, 1, 1, 1492387200, 1489835442, 1489835553, 2, 2, 0),
(7, 'Junior Engineer ', '<p>we are looking for a candidate who can work full time/ part time with us. we are into fire &amp; safety products. we are looking for application engineer. simple work procedure. 12th above and diploma are preferred with basic english and kannada language.</p>\r\n<p>Job Type: Fresher</p>\r\n<p>Salary: 10,000.00 /month</p>\r\n<p>Required language:</p>\r\n<p>Kannada, english</p>', 'Jotihkannan', 'Fourbends', 20, 1, 1, 1492387200, 1489842137, 1490356682, 18, 2, 0),
(8, 'Immediate Opening for Mechanical Fresher', '<p style="color: #222222; font-family: arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;">We have urgent requirement for Mechanical Engineer leading MNCs in Manglore freshers candidate also can apply</p>\r\n<p style="color: #222222; font-family: arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;">No interview , Direct Placement</p>\r\n<p style="color: #222222; font-family: arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;">Designation: GET/Trainee Engineer (Quality, Production, Maintenance)</p>\r\n<p style="color: #222222; font-family: arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;">Work Location: Manglore</p>\r\n<p style="color: #222222; font-family: arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;">Language: English Must</p>\r\n<p style="color: #222222; font-family: arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;">Interested Candidate can walk in directly</p>', 'louis HR - 72956775435', 'PSWRJ Global Solution', 9, 0, 1, 1495497600, 1490339974, 1490341513, 2, 2, 0);
