INSERT INTO `scwxm_local_scwvideos` (`id`, `video_heading`, `video_description`, `video_thumb`, `video_content`, `video_contentformat`, `video_porder`, `video_share`, `video_status`, `video_created`, `video_modified`, `video_created_by`, `video_modified_by`, `video_delete`, `video_preview`) VALUES
(1, 'What is Supply Chain Management', 'Part 1 of 12 - This module introduces viewers to the field of supply chain management. \r\nIt describes the complex supply chain of a simple product, a bottle of water. \r\nThe video also illustrates the importance of supply chain managers and their skill sets in our modern global economy for both manufacturing and service industries. \r\nIn defining supply chain management, the video also hopes to educate and inspire business students, young and old, about the opportunities available to those with supply chain management degrees.\r\n\r\nThis is the first installment in Arizona State University''s twelve-part introduction to supply chain management video series. ASU, \r\nthe W. P. Carey School of Business, and the Supply Chain Management Department are proud and happy to share this video series with supply chain management departments, \r\nsupply chain instructors, career specialists in high schools and universities, \r\nas well as industry leaders in an effort to inspire a new generation of supply chain management professionals across the country and around the world. ', '1', '<p><a href="@@PLUGINFILE@@/Test.mp4">Test.mp4</a></p>', 1, 1, 1, 1, 1490286385, 1490356050, 2, 2, 0, 0),
(2, 'Module 2 Buy It Managing Supply ASU-WPC-SCM', 'Part 2 of 12 Part introduction to purchasing, part homage to the 1970s Time for Timer You are What You Eat public service announcement, this module explains the critical role supply management plays in producing high quality products and services. Procurement managers require a specific set of varied skills to ensure your supply chain has a continuous flow of healthy materials from dependable suppliers.\r\n\r\nThis is the 2nd installment in Arizona State University''s twelve-part introduction to supply chain management video series developed by Eddie Davila, Jeff Hough, Randy Cates, Dawn Feldman, Dan Ichikawa, Ian Schmoel, and Matt Hardy. ASU, the W. P. Carey School of Business, and the Supply Chain Management Department are proud and happy to share this video series with supply chain management departments, supply chain instructors, career specialists in high schools and universities, as well as industry leaders in an effort to inspire a new generation of supply chain management professionals across the country and around the world. ', '1', '<p><a href="http://www.youtube.com/v/zYbtZ0x9_SA">Module 2: Buy It: Managing Supply (ASU-WPC-SCM)</a></p>', 1, 2, 1, 1, 1490356225, 1490356225, 2, 2, 0, 0);
