(24, 'Hello there', '<div class="el__leafmedia el__leafmedia--sourced-paragraph">\r\n<p class="zn-body__paragraph">New York City and Philadelphia have been spared the worst of a nor''easter, but the storm waswalloping other parts of the region with heavy snow and high winds. Millions of people were still in the path of blizzard conditions.</p>\r\n</div>\r\n<div class="zn-body__paragraph">The storm brought chaos to travel and daily life, with about<span></span>8,800 US flights canceled between Monday and Wednesday and thousands of schools closed. Connecticut banned highway travel for several hours Tuesday, and some major regional rail traffic was suspended. Four weather-related deaths were reported in three states.</div>\r\n<div class="el__embedded el__embedded--fullwidth">\r\n<div class="element-raw appearance-fullwidth">\r\n<div id="storm-tracker"><iframe src="http://www.cnn.com/interactive/storm-tracker/embed.html?initialWidth=780&amp;childId=storm-tracker&amp;parentTitle=Millions%20still%20under%20blizzard%20warning%20in%20Northeast%20-%20CNN.com&amp;parentUrl=http%3A%2F%2Fwww.cnn.com%2F2017%2F03%2F14%2Fus%2Fnortheast-winter-weather%2F" frameborder="0" marginheight="0" scrolling="no" width="100%" height="472px"></iframe></div>\r\n</div>\r\n</div>\r\n<div class="zn-body__paragraph">Normalcy trickled back as some train services and flights resumed Tuesday evening. But a blizzard warning remained in<span></span>effect for parts of Pennsylvania, upstate New York and most of New England. The warning affected nearly 5 million people, the National Weather Service said.</div>\r\n<p></p>\r\n<div class="el__embedded el__embedded--standard"></div>', NULL, NULL, 1489545092),
