(1, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, '307376699', '303165345', 'supply manager,sales', 1, 'Seeking an Entry-Level Position Within the Renewable-Energy Sector.\r\n\r\nRecent BSEE graduate and EIT with experience as an electrical engineer intern for a major solar power solutions manufacturer. Possess the analytical abilities and technical skills necessary for engineering innovative designs and applications. Solid understanding of electrical engineering theory, industry-standard circuit design, testing tools and photovoltaic (PV) systems.', 1, 'zbSaDT5U', 1, NULL, 1488610073, 1489214873, NULL, NULL, 4, 1, 1, 1, 2, '<p><em><strong>Test a word</strong></em></p>', 1, '', ''),
(2, 1, NULL, NULL, 'humanitarian-logistics', NULL, 'education', NULL, NULL, NULL, NULL, 1, '80929786', NULL, NULL, 1, 'Extensive experience in humanitarian logistics management within the field of supply chain management (procurement, tendering, contracting, clearance, transport, warehousing, etc.) fleet management and asset management, distribution support.\r\nProven record on the ability and experience of the management of logistics team on a senior level. ', 1, 'mPj1qkmj', 1, NULL, 1488612250, 1489217050, NULL, NULL, 5, 1, 1, 2, 2, NULL, 1, NULL, NULL),
(3, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, '740906084', NULL, NULL, 1, 'Upcoming graduate of ABET-accredited bachelor''s-degree program seeking an entry-level aerospace engineer position. Completed flight test internship with XYZ Company and assisted in research study that examined methods for improving Boeing 737 flight acoustics. Academic studies have provided a foundation in aerodynamics and physics; structural dynamics; systems design and testing; flight mechanics and controls; and 2D and 3D CAD design tools.\r\n', 1, '8leOSXTj', 1, NULL, 1488612569, 1489217369, NULL, NULL, 6, 1, 1, 1, 1, '', 1, NULL, NULL),
(4, 1, NULL, NULL, 'demand-forecast-planning', NULL, 'education', NULL, NULL, NULL, NULL, 1, '729525688', NULL, NULL, 1, 'Managed the global demand analysis and forecast for products worth $3M, including the company''s fastest growing categories. Assisted Buyers/Supply planners to manage inventory. Maintained and reported forecast KPIs, such as forecast accuracy, bias and MAPE. Identified excess inventory ($80K) and developed a sales plan jointly with the Sales management to sell that inventory and thus reducing the total inventory costs by 6%. Managed all aspects of demand analysis and forecasting contributing to increased profit (11% to 18%). Developed and implemented analytical tools using MS to help the planners in day-to-day activities, resulting in increased forecast accuracy by 12%.', 1, 'THzlSqR8', 1, NULL, 1488630353, 1489235153, NULL, NULL, 7, 1, 1, 1, 1, '', 1, NULL, NULL),
(5, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, '89350742', NULL, NULL, 1, 'Upcoming graduate of ABET-accredited bachelors in civil engineering program. Backed by successful internship experience and knowledge of engineering theories, principles, specifications and standards. Plan to earn Engineer in Training certification upon graduation. Demonstrated 3D skills with the ability to design site layouts from concept through completion. Proficient user of AutoCAD Civil 3D, MicroStation and ArcGIS. Knowledge of Sometown, MI Municipalities Planning Code and zoning, subdivision and storm water ordinances.', 1, 'fZmv1qOD', 1, NULL, 1488630828, 1489235628, NULL, NULL, 8, 1, 1, 1, 1, '', 1, NULL, NULL),
(6, 1, NULL, NULL, 'sourcing', NULL, 'education', NULL, NULL, NULL, NULL, 1, '933258398', NULL, NULL, 1, 'As a HR Sourcing Specialist/Recruiter, Collaborate with recruiters to understand specific position requirements, job responsibilities and how they relate to business goals. Screen and qualify prospective candidates and provide feedback to the recruitment team. Support the Recruitment Team by recruiting candidates from online databases and social networks as well as passive, qualified candidates through networking, cold calling, internet searches and research. Create a pipeline of internal and external candidates for corporate and international positions. Gain a clear understanding of our business units and associated staffing needs to anticipate and plan for current and future sourcing activities. Design, develop and execute sourcing strategies that align with the business groups staffing objectives, both short and long-term. Partnering with other recruiting team members to align qualified candidates with appropriate positions and work with them through the selection process.\r\n', 1, 'IA5XoOPz', 1, NULL, 1488633220, 1489238020, NULL, NULL, 9, 1, 1, 1, 1, '', 1, '', ''),
(7, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, '20142043', '124777717', 'Php, mysql', 1, 'Junior Web developer able to build a Web presence from the ground up -- from concept, navigation, layout and programming to UX and SEO. Skilled at writing well-designed, testable and efficient code using current best practices in Web development. Fast learner, hard worker and team player who is proficient in an array of scripting languages and multimedia Web tools.', 1, 'IORM3CrR', 1, NULL, 1488633522, 1489238322, NULL, NULL, 10, 1, 1, 1, 1, '', 1, '', ''),
(8, 1, NULL, NULL, 'sourcing', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, 1, 'As a Strategic Sourcing Manager, Manage contracting and supplier relationship activities for a multi-million dollar healthcare category.\r\nDeveloped sourcing plan for a new service; drafted negotiation plans and executed SOWs and contract resulting in $2.6M in savings.\r\nEvaluated and managed suppliers using scorecards, dashboards and facilitating quarterly business reviews. Conducted RFPs and RFQs to identify qualified suppliers and negotiate best rates.', 1, '8uiwd7qc', 1, NULL, 1488684537, 1489289337, NULL, NULL, 11, 1, 1, 1, 1, NULL, 1, NULL, NULL),
(9, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, NULL, NULL, NULL, 1, 'College junior majoring in manufacturing engineering technology who is highly motivated to secure a design engineer internship. Honors student with practical work experience within the manufacturing sector; technical skills in AutoCAD, SolidWorks and Creo Elements/Pro; and a foundation in automated manufacturing systems and simulation modelling techniques.', 1, 'lxmXLGhI', 1, NULL, 1488684642, 1489289442, NULL, NULL, 12, 1, 1, 1, 1, NULL, 1, NULL, NULL),
