(14, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, NULL, NULL, NULL, 1, 'Recent graduate of ABET-accredited BSME program seeking an entry-level mechanical engineering position.\r\nKey skills and knowledge areas:\r\nSolid command of technologies, tools and best practices in designing mechanical equipment using AutoCAD, SolidWorks and engineering drawings.Excellent shop and safety skills honed from work as a machinist and welder. Able to design and fabricate tooling and mechanical test fixtures.Strong team collaboration skills. Work closely with team members to achieve engineering goals.', 1, '2BI7jLcz', 1, NULL, 1488950708, 1489555508, NULL, NULL, 21, 1, 1, 1, 1, NULL, 1, NULL, NULL),
(15, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 0, NULL, NULL, NULL, 1, 'Seeking an Entry-Level Position with a Software Solutions Provider\r\nBSISE graduate with CAPM certification and experience as an engineering project manager intern. Proven success in managing project scopes, budgets, schedules and deliverables throughout all phases of the software development lifecycle. Combine technical and analytical aptitudes with problem-solving strengths to drive projects to on-time, on-budget and high-quality completion.Exceptional focus on customer service and passion for working in a customer-facing role, while building partnerships with stakeholders across the company.\r\nProficient in MS Project, MS Excel, AutoCAD, C, C++, Oracle and Windows Server.', 1, 'V2OSc5lJ', 1, NULL, 1488958188, 1489562988, NULL, NULL, 22, 1, 1, 1, 1, NULL, 1, NULL, NULL),
(16, 1, NULL, NULL, 'supply-chain-education', NULL, 'education', NULL, NULL, NULL, NULL, 1, '201480651', NULL, NULL, 1, 'Dedicated Educator with extensive experience developing curriculum and delivering exceptional educational excellence in Secondary Education. Key Strengths: Talent for inspiring students to higher levels of academic success. Dynamic and engaging; establish and maintain lasting rapport with instructional assistants and para-educators, teachers, building administrators, and parents.', 1, 'v7Khupl0', 1, NULL, 1488972145, 1489576945, NULL, NULL, 23, 1, 1, 1, 1, '', 1, NULL, NULL),
