(18, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, NULL, NULL, NULL, 1, 'Analytical research scientist with more than two years of experience contributing to tissue-engineered research studies for products that improve lives through regenerative medicine. Background includes participation in groundbreaking research in the areas of tissue engineering, cell biology and protein biochemistry. Experience running bio essays and laboratory bench studies, writing scientific reports and maintaining research lab operations and equipment.', 1, '6mCcse3m', 1, NULL, 1489052711, 1489657511, NULL, NULL, 25, 1, 1, 1, 1, NULL, 1, NULL, NULL),
