(20, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, '339938589', '629535016', 'RRRR', 1, 'Dedicated researcher offering excellence in molecular biology techniques, including DNA sample preparation, quantitation and sequencing. Familiar with SQL and ISIS, protein expression and purification techniques. Background includes providing scientific input during the development and execution of clinical trialsin both medical-research and clinical-testing facilities. Proven ability to organize, prioritize and assist with multiple research projects and comply with GCP, ICH and FDA standards. Stay up-to-date in the field of clinical pathology through participation in professional lab organizations and review of current research topics.', 1, 'zbSaDT5U', 1, NULL, 1488610073, 1489214873, NULL, NULL, 3, 1, 0, 1, 1, '', 1, '', ''),
