(25, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 1, '970748505', NULL, NULL, 1, 'As a Entry-Level Software Quality Engineer, Highly motivated technology professional launching career as a software quality engineer. Bring to the table hands-on experience in the testing of software systems supporting VB.Net products and interfaces. Knowledge of standard industry QA methodologies and the Software Development Life Cycle (SDLC). Familiar with MS programming technologies including .Net Framework, C#, VB.Net, SQL Server, T-SQL, IIS and ASP. Dedicated to continuing professional development  recently earned Java SE 7 Programmer certification and completed an intensive VB.Net training program.', 1, '8Lv647Gn', 1, NULL, 1489147087, 1489751887, 1489159073, 1489162673, 31, 1, 1, 1, 1, '', 1, NULL, NULL),
(26, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, '50.00', NULL, 0, '460308381', NULL, NULL, 1, 'Database administrator (DBA) with extensive experience designing, coding, testing and supporting next-generation database solutions in Oracle enterprise and SQL Server environments. Proficient in an assortment of technologies, including Oracle 9i/10g, DB2, Access, Sybase, MS SQL Server, JDBC, Visio, Apache Web Server, Java, C++, XML, Windows and Linux (complete list on request). DBA skills include: Oracle 10g Database Administration, Performance Tuning & Capacity Monitoring. Data Security, Backup & Recovery, Standby/Failover Administration, Oracle RAC & ASM Administration/Installation, Oracle Forms and Reports Development, Database-Backed Web Solutions, SQL Tuning in an Oracle Environment', 1, 'HieFNtKh', 1, NULL, 1489159966, 1489764766, 1489160140, 1489163740, 32, 1, 1, 1, 1, '', 1, NULL, NULL),
