(11, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 1, NULL, NULL, NULL, 1, 'Seeking an Entry-Level Position Within the Renewable-Energy Sector. Recent BSEE graduate and EIT with experience as an electrical engineer intern for a major solar power solutions manufacturer. Possess the analytical abilities and technical skills necessary for engineering innovative designs and applications. Solid understanding of electrical engineering theory, industry-standard circuit design, testing tools and photovoltaic (PV) systems.', 1, 'UQq2EUMe', 1, NULL, 1488765876, 1489370676, NULL, NULL, 14, 1, 1),
(12, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 1, NULL, NULL, NULL, 1, 'Quality-focused manufacturing engineer offering a broad knowledge of manufacturing processes, experience using Creo Elements/Pro and SolidWorks 2010 and keen process-development skills gained through completion of capstone project with a leading auto-parts manufacturer. Bachelors in manufacturing engineering program provided a strong educational foundation in the following engineering areas: Product Engineering & Quality, Engineering Drawing; Engineering Graphics Using Solid Modeling; Design of Jigs, Fixtures & Tooling; Quality Engineering; Lean Manufacturing Systems; Six Sigma Tools', 1, 'ODTvfWtB', 1, NULL, 1488886544, 1489491344, NULL, NULL, 19, 1, 1),
(13, 1, NULL, NULL, 'supply-chain-education', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, 1, 'Lead programmer with a track record of incorporating user and business requirements into cost-effective, secure and user-friendly solutions known for scalability and durability. ', 1, '1VBM8xLS', 1, NULL, 1488891995, 1489496795, NULL, NULL, 20, 1, 1),
(14, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 1, NULL, NULL, NULL, 1, 'Recent graduate of ABET-accredited BSME program seeking an entry-level mechanical engineering position.\r\nKey skills and knowledge areas:\r\nSolid command of technologies, tools and best practices in designing mechanical equipment using AutoCAD, SolidWorks and engineering drawings.Excellent shop and safety skills honed from work as a machinist and welder. Able to design and fabricate tooling and mechanical test fixtures.Strong team collaboration skills. Work closely with team members to achieve engineering goals.', 1, '2BI7jLcz', 1, NULL, 1488950708, 1489555508, NULL, NULL, 21, 1, 1),
(15, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 0, NULL, NULL, NULL, 1, 'Seeking an Entry-Level Position with a Software Solutions Provider\r\nBSISE graduate with CAPM certification and experience as an engineering project manager intern. Proven success in managing project scopes, budgets, schedules and deliverables throughout all phases of the software development lifecycle. Combine technical and analytical aptitudes with problem-solving strengths to drive projects to on-time, on-budget and high-quality completion.Exceptional focus on customer service and passion for working in a customer-facing role, while building partnerships with stakeholders across the company.\r\nProficient in MS Project, MS Excel, AutoCAD, C, C++, Oracle and Windows Server.', 1, 'V2OSc5lJ', 1, NULL, 1488958188, 1489562988, NULL, NULL, 22, 1, 1),
(16, 1, NULL, NULL, 'supply-chain-education', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, 1, 'Dedicated Educator with extensive experience developing curriculum and delivering exceptional educational excellence in Secondary Education. Key Strengths: Talent for inspiring students to higher levels of academic success. Dynamic and engaging; establish and maintain lasting rapport with instructional assistants and para-educators, teachers, building administrators, and parents.', 1, 'v7Khupl0', 1, NULL, 1488972145, 1489576945, NULL, NULL, 23, 1, 1),
(17, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 1, NULL, NULL, NULL, 1, 'As an Entry-Level Mechanical Designer, CAD & CAE Tools: AutoCAD, SolidWorks, FEMtools and TurboCAD. BSET student offering experience using CAD and CAE tools, a foundation in 2D/3D modeling and structural design, and a drive for performance excellence.\r\nHands-on experience creating mechanical design drawings using SolidWorks and configuring components using AutoCAD. Academic career distinguished by Deans List honors and extracurricular leadership success.', 1, '4Mvs2aEG', 1, NULL, 1488973488, 1489578288, NULL, NULL, 24, 1, 1),
(18, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 1, NULL, NULL, NULL, 1, 'Analytical research scientist with more than two years of experience contributing to tissue-engineered research studies for products that improve lives through regenerative medicine. Background includes participation in groundbreaking research in the areas of tissue engineering, cell biology and protein biochemistry. Experience running bio essays and laboratory bench studies, writing scientific reports and maintaining research lab operations and equipment.', 1, '6mCcse3m', 1, NULL, 1489052711, 1489657511, NULL, NULL, 25, 1, 1),
(19, 1, NULL, NULL, 'inventory', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, 1, 'Practiced knowledge about various tasks involved in inventory management. Introduced work processes which improved inventory control and eliminated the discrepancies.\r\n', 1, 'KIIhnLdr', 1, NULL, 1489053687, 1489658487, NULL, NULL, 26, 1, 1),
(20, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 1, NULL, NULL, NULL, 1, 'Dedicated researcher offering excellence in molecular biology techniques, including DNA sample preparation, quantitation and sequencing. Familiar with SQL and ISIS, protein expression and purification techniques. Background includes providing scientific input during the development and execution of clinical trialsin both medical-research and clinical-testing facilities. Proven ability to organize, prioritize and assist with multiple research projects and comply with GCP, ICH and FDA standards. Stay up-to-date in the field of clinical pathology through participation in professional lab organizations and review of current research topics.', 1, 'zbSaDT5U', 1, NULL, 1488610073, 1489214873, NULL, NULL, 3, 1, 0),
(21, 2, NULL, NULL, NULL, NULL, NULL, NULL, 1, 50.00, NULL, 1, NULL, NULL, NULL, 1, 'Hardworking, entry-level chemist offering a year of lab-testing experience within the FDA- and cGMP-regulated environment of health and beauty products manufacturing. In-depth knowledge of wet chemistry and titration methods; experience using instrumentation such as AA, FTIR, HPLC, GC and ICP.\r\nTechnically proficient  advanced user of Mathematica, Spartan''10 and GAMESS.', 1, 'K5uqyrBq', 1, NULL, 1489071398, 1489676198, 1489072417, 1489076017, 27, 1, 1),
(22, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, 1, 'Dedicated customer service manager with 15+ years of experience in "big box" retail and food service settings. Consistently achieve record-high customer satisfaction rankings, improvements to the bottom line and turnaround of underperforming operations. Respected builder and leader of customer-focused teams; instill a shared, enthusiastic commitment to customer service as a key driver of company goal attainment. Lead by example and ensure the execution of all safety, security, quality and store operations policies. ', 1, 'hxONdEMl', 1, NULL, 1489144534, 1489749334, NULL, NULL, 28, 1, 1),
(23, 1, NULL, NULL, 'supply-chain-management-for-marketing', NULL, 'education', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, 1, 'Accomplished executive assistant offering 12 years of administrative experience reporting to a CEO and other top executives.\r\nConsummate professional dedicated to making the lives of busy executives easier. Serve as an effective gatekeeper; prepare well-researched and accurate documents; manage busy calendars; and efficiently handle daily office tasks. Proficient user of MS Office (Word, Excel, PowerPoint, Access and Outlook). Type 75 WPM.', 1, 'ZOLvubu4', 1, NULL, 1489145142, 1489749942, NULL, NULL, 29, 1, 1),
(24, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 0, NULL, NULL, NULL, 1, 'Hardworking, entry-level chemist offering a year of lab-testing experience within the FDA- and cGMP-regulated environment of health and beauty products manufacturing. In-depth knowledge of wet chemistry and titration methods; experience using instrumentation such as AA, FTIR, HPLC, GC and ICP. Technically proficient  advanced user of Mathematica, Spartan''10 and GAMESS.', 1, 'XJQmxLNB', 1, NULL, 1489145231, 1489750031, NULL, NULL, 30, 1, 1),
(25, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 1, NULL, NULL, NULL, 1, 'As a Entry-Level Software Quality Engineer, Highly motivated technology professional launching career as a software quality engineer. Bring to the table hands-on experience in the testing of software systems supporting VB.Net products and interfaces. Knowledge of standard industry QA methodologies and the Software Development Life Cycle (SDLC). Familiar with MS programming technologies including .Net Framework, C#, VB.Net, SQL Server, T-SQL, IIS and ASP. Dedicated to continuing professional development  recently earned Java SE 7 Programmer certification and completed an intensive VB.Net training program.', 1, '8Lv647Gn', 1, NULL, 1489147087, 1489751887, 1489159073, 1489162673, 31, 1, 1),
(26, 2, NULL, NULL, NULL, NULL, NULL, NULL, 0, 50.00, NULL, 0, NULL, NULL, NULL, 1, 'Database administrator (DBA) with extensive experience designing, coding, testing and supporting next-generation database solutions in Oracle enterprise and SQL Server environments. Proficient in an assortment of technologies, including Oracle 9i/10g, DB2, Access, Sybase, MS SQL Server, JDBC, Visio, Apache Web Server, Java, C++, XML, Windows and Linux (complete list on request). DBA skills include: Oracle 10g Database Administration, Performance Tuning & Capacity Monitoring. Data Security, Backup & Recovery, Standby/Failover Administration, Oracle RAC & ASM Administration/Installation, Oracle Forms and Reports Development, Database-Backed Web Solutions, SQL Tuning in an Oracle Environment', 1, 'HieFNtKh', 1, NULL, 1489159966, 1489764766, 1489160140, 1489163740, 32, 1, 1),
